    Cookie.prototype.set = function (name, value, daysValid) {
        var d = new Date();
        d.setTime(d.getTime() + (daysValid * 24 * 60 * 60 * 1000));

        var expires = "expires=" + d.toUTCString();
        document.cookie = name + "=" + value.toString() + "; " + expires + "; path=/";

        return true;
    };

